address add2=0x3C44CdDdB6a900fa2b585dd299e03d12FA4293BC;
constructor(address _university) public {
  address storageContractAdress=0x15f789a975c6cE71989F3D4e10afA07AD586Dea8;
  addressStorageContract = AddressStorageContract(storageContractAdress);
  university=_university;
  ministry=0xf39Fd6e51aad88F6F4ce6aB8827279cffFb92266;
    }
  modifier onlyuniv() { 
         require(msg.sender==university, "not university"); 
          _;     
     }

    //  function getTypee(address add) view public returns(uint)
    //  {   uint x=addressStorageContract.getType(add);

    // return(x);


    //  }

   function CreateNewDiploma(address faculty,string memory name)  public{

     Diploma diploma = new Diploma( ministry,msg.sender, faculty);
     DiplomaArray.push(diploma);
     address addrs_contrct=diploma.getAddress();
    addressStorageContract.AddAddress(faculty,addrs_contrct,name);
     
    //  Addresses[faculty]=2;
   }
function gethello() public view returns(string memory)
{
  return("hello");

}
 function getcontractaddress()
        public
        view
        returns (uint)
    {
        return DiplomaArray.length;
    }

}

